import React from "react";
import ReactDOM from "react-dom";
import "../componentCss/PortContentListCss.css";
import "../grid.css";
import PortContent from "./PortContent";

class PortContentList extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      source: ["source 1", "source 2", "source 3"],
      describeHeader: ["Bird Mockup", "Original Poster", "Finale Project"],
      describe: ["Made in 2018", "Made by wood", "Made in Vietnam"],
    };
  }

  renderContent = () => {
    for (let i = 0; i < 3; i++) {
      return <PortContent source={this.state.source[i]} />;
    }
  };
  render() {
    return (
      <div className="wide grid row portfolio-content">
        <PortContent />
      </div>
    );
  }
}

export default PortContentList;
